import{_ as a,c as o,a2 as r,o as t}from"./chunks/framework.Dz7_3PEu.js";const f=JSON.parse('{"title":"FAQs","description":"","frontmatter":{"summary":"Perguntas frequentes sobre o AdonisJS, o framework e seu ecossistema."},"headers":[],"relativePath":"docs/preface/faqs.md","filePath":"docs/preface/faqs.md"}'),s={name:"docs/preface/faqs.md"};function i(n,e,d,l,m,c){return t(),o("div",null,e[0]||(e[0]=[r('<h1 id="faqs" tabindex="-1">FAQs <a class="header-anchor" href="#faqs" aria-label="Permalink to &quot;FAQs&quot;">​</a></h1><h2 id="quem-mantem-o-adonisjs" tabindex="-1">Quem mantém o AdonisJS? <a class="header-anchor" href="#quem-mantem-o-adonisjs" aria-label="Permalink to &quot;Quem mantém o AdonisJS?&quot;">​</a></h2><p>O AdonisJS é um projeto independente criado por <a href="https://twitter.com/AmanVirk1" target="_blank" rel="noreferrer">Harminder Virk</a> em 2015. O framework é mantido ativamente pela <a href="https://github.com/orgs/adonisjs/people" target="_blank" rel="noreferrer">equipe principal</a> e pelos colaboradores da comunidade.</p><p>O criador do framework (Harminder Virk) é o líder do projeto e trabalha em tempo integral no framework.</p><p>O projeto é financiado pelo GitHub Sponsors. Se você ou sua empresa se beneficiam do AdonisJS, considere <a href="https://github.com/sponsors/thetutlage" target="_blank" rel="noreferrer">nos patrocinar para dar suporte ao desenvolvimento do framework</a>.</p><h2 id="como-o-adonisjs-e-licenciado" tabindex="-1">Como o AdonisJS é licenciado? <a class="header-anchor" href="#como-o-adonisjs-e-licenciado" aria-label="Permalink to &quot;Como o AdonisJS é licenciado?&quot;">​</a></h2><p>AdonisJS (o framework) e os pacotes oficiais são distribuídos sob a <a href="https://opensource.org/license/mit/" target="_blank" rel="noreferrer">Licença MIT</a>. Além disso, o código-fonte está disponível publicamente no <a href="https://github.com/adonisjs" target="_blank" rel="noreferrer">GitHub</a>.</p><h2 id="o-adonisjs-e-confiavel-e-bem-mantido" tabindex="-1">O AdonisJS é confiável e bem mantido? <a class="header-anchor" href="#o-adonisjs-e-confiavel-e-bem-mantido" aria-label="Permalink to &quot;O AdonisJS é confiável e bem mantido?&quot;">​</a></h2><p>O AdonisJS é usado na produção por <a href="https://www.marieclaire.com/" target="_blank" rel="noreferrer">Marie Claire</a>, <a href="https://cleavr.io" target="_blank" rel="noreferrer">Cleavr</a>, <a href="https://www.ledger.com/" target="_blank" rel="noreferrer">Ledger</a>, <a href="https://cavai.com" target="_blank" rel="noreferrer">Cavai</a>, <a href="https://kayako.com" target="_blank" rel="noreferrer">Kayako</a>, <a href="https://www.renaultgroup.com/en/" target="_blank" rel="noreferrer">Renault Group</a>, <a href="https://www.zakodium.com/" target="_blank" rel="noreferrer">Zakodium</a>, <a href="https://www.fivb.com" target="_blank" rel="noreferrer">FIVB</a> e muitas outras empresas em capacidades variadas.</p><p>O criador do framework trabalha em tempo integral no AdonisJS e garante que o framework seja ativamente aprimorado e mantido.</p><ul><li>Durante o lançamento da v6, migramos para o sistema de módulo ES.</li><li>Pacotes mantidos oficialmente têm zero vulnerabilidades de segurança relatadas pela verificação de segurança do Snyk.</li><li>Trabalhamos continuamente para escrever melhor documentação, lançar novos recursos e melhorar a base de código existente.</li></ul><h2 id="o-adonisjs-e-rapido" tabindex="-1">O AdonisJS é rápido? <a class="header-anchor" href="#o-adonisjs-e-rapido" aria-label="Permalink to &quot;O AdonisJS é rápido?&quot;">​</a></h2><p>Ao criar o framework ou adicionar novos recursos, focamos principalmente em resolver problemas do mundo real em vez de reduzir a funcionalidade para fazer o AdonisJS vencer as Olimpíadas de benchmark.</p><p>No entanto, olhamos mais de perto as métricas de desempenho e ajustamos o desempenho do framework onde for importante. Por exemplo:</p><ul><li><a href="https://github.com/adonisjs/http-server/blob/main/benchmarks.md" target="_blank" rel="noreferrer">no mesmo nível do Fastify em desempenho</a>.</li><li><a href="https://github.com/vinejs/vine/blob/main/benchmarks.md" target="_blank" rel="noreferrer">supera outras bibliotecas de validação populares</a> no ecossistema Node.js.</li></ul><h2 id="voces-oferecem-suporte-pago" tabindex="-1">Vocês oferecem suporte pago? <a class="header-anchor" href="#voces-oferecem-suporte-pago" aria-label="Permalink to &quot;Vocês oferecem suporte pago?&quot;">​</a></h2><p>Sim! Em nosso site, você pode aprender mais sobre o <a href="https://adonisjs.com/support_program" target="_blank" rel="noreferrer">programa de suporte prioritário</a>.</p><h2 id="como-me-mantenho-atualizado-com-o-adonisjs" tabindex="-1">Como me mantenho atualizado com o AdonisJS? <a class="header-anchor" href="#como-me-mantenho-atualizado-com-o-adonisjs" aria-label="Permalink to &quot;Como me mantenho atualizado com o AdonisJS?&quot;">​</a></h2><p>Confira os links a seguir para se manter conectado e atualizado.</p><ul><li><a href="https://discord.gg/vDcEjq6" target="_blank" rel="noreferrer">Servidor Discord</a></li><li><a href="https://twitter.com/adonisframework" target="_blank" rel="noreferrer">X (antigo Twitter)</a></li><li><a href="https://github.com/orgs/adonisjs/discussions" target="_blank" rel="noreferrer">Discussões do GitHub</a></li><li><a href="https://adonisjs.com/blog?referrer=adonisjs_docs_faq" target="_blank" rel="noreferrer">Blog e Newsletter</a></li><li><a href="https://adocasts.com/?referrer=adonisjs_docs_faq" target="_blank" rel="noreferrer">Adocasts</a></li></ul>',20)]))}const h=a(s,[["render",i]]);export{f as __pageData,h as default};
